import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { AppProvider } from "./context/AppContext";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Login from "./components/Login";
import Register from "./components/Register";
import SectionManagement from "./components/SectionManagement";
import EbookManagement from "./components/EbookManagement";
import RequestManagement from "./components/RequestManagement";
import FeedbackManagement from "./components/FeedbackManagement";
import EbookDetail from "./components/EbookDetail";
import AvailableBooks from "./components/AvailableBooks";
import UserProfile from "./components/UserProfile";
import NotFound from "./components/NotFound";
import Footer from "./components/Footer";
import { ToastContainer } from "react-toastify";
import "./index.css";

// PrivateRoute - handles role-based access control
const PrivateRoute = ({ role, children }) => {
  const { user } = React.useContext(AppContent); // Get user info from context

  // Check if the user is logged in and has the correct role
  if (user && user.role === role) {
    return children; // Authorized user, return the component
  }

  return <NotFound />; // Unauthorized user, show 404 page
};

const App = () => {
  return (
    <AppProvider>
      <Router>
        <div className="main-container">
          <Navbar />
          <div className="content">
            <ToastContainer position="top-center" autoClose={1000} />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* For librarian routes */}
              <Route
                path="/librarian"
                element={
                  <PrivateRoute role="librarian">
                    <SectionManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-sections"
                element={
                  <PrivateRoute role="librarian">
                    <SectionManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-ebooks"
                element={
                  <PrivateRoute role="librarian">
                    <EbookManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-requests"
                element={
                  <PrivateRoute role="librarian">
                    <RequestManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-feedbacks"
                element={
                  <PrivateRoute role="librarian">
                    <FeedbackManagement />
                  </PrivateRoute>
                }
              />

              {/* For user routes */}
              <Route
                path="/ebook/:id"
                element={
                  <PrivateRoute role="user">
                    <EbookDetail />
                  </PrivateRoute>
                }
              />
              <Route
                path="/available-books"
                element={
                  <PrivateRoute role="user">
                    <AvailableBooks />
                  </PrivateRoute>
                }
              />
              <Route
                path="/profile"
                element={
                  <PrivateRoute role="user">
                    <UserProfile />
                  </PrivateRoute>
                }
              />

              {/* 404 page */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>
          <Footer />
        </div>
      </Router>
    </AppProvider>
  );
};

export default App;
